// frontend/src/pages/Login.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import authService from '../services/authService';
import './login.css';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      const response = await authService.login(email, password);
      
      if (response.success) {
        // حفظ token وبيانات المستخدم
        localStorage.setItem('token', response.token);
        localStorage.setItem('user', JSON.stringify(response.user));
        
        // توجيه بناءً على الدور
        if (response.user.role === 'employee') {
          navigate('/employee/dashboard');
        } else {
          navigate('/admin/dashboard');
        }
      } else {
        setError(response.error || 'فشل تسجيل الدخول');
      }
    } catch (err) {
      setError('حدث خطأ في الاتصال بالسيرفر');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="login-container">
      <div className="login-card">
        <div className="login-logo">
          <img 
            src="/images/logol3bty.jpg" 
            alt="L3BTY Logo" 
            className="logo"
          />
          <h2>نظام تأجير L3BTY</h2>
          <p className="text-muted">يرجى تسجيل الدخول للوصول إلى النظام</p>
        </div>

        {error && (
          <div className="alert alert-danger" role="alert">
            {error}
          </div>
        )}

        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label htmlFor="email" className="form-label">
              البريد الإلكتروني
            </label>
            <input
              type="email"
              className="form-control"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              placeholder="ادخل بريدك الإلكتروني"
            />
          </div>

          <div className="mb-3">
            <label htmlFor="password" className="form-label">
              كلمة المرور
            </label>
            <input
              type="password"
              className="form-control"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              placeholder="ادخل كلمة المرور"
            />
          </div>

          <button 
            type="submit" 
            className="btn btn-primary w-100"
            disabled={loading}
          >
            {loading ? 'جاري تسجيل الدخول...' : 'تسجيل الدخول'}
          </button>
        </form>

        <div className="mt-3 text-center">
          <p className="text-muted">
            للوصول للنظام استخدم:<br />
            <small>
              <strong>الموظف:</strong> employee1@l3bty.com / كلمة المرور: 123456<br />
              <strong>المدير:</strong> manager1@l3bty.com / كلمة المرور: 123456<br />
              <strong>المدير العام:</strong> admin@l3bty.com / كلمة المرور: 123456
            </small>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Login;
